import React from 'react';

function About() {
  return (
    <div>
      <h2>About Our Company</h2>
      <p>
        We are a construction company with over 10 years of experience in residential and commercial projects. 
        Our mission is to provide high-quality, sustainable construction solutions that exceed our clients' expectations.
      </p>
    </div>
  );
}

export default About;
